import './header.css'

import logo from '../../../graphics/logo_black.png'

function Header() {
  return (
    <header className="header">
        <div>
            <section className="logo">
            <img  src={mainLogo} style={nbStyle.logo} alt="fireSpot"/>
            </section>
        </div>
    </header>
  );
}

export default Header;
